import React, { Component } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';



class Header extends React.Component {
  render() {
    return (
      <div class="header">
        <header className="container">
          <h1 > Let's get you sleeping right!</h1> 
          <br/>
          <br/>
          <p>
            ... or keep scrolling to learn more about the science of sleep!
          </p>
          <br/>
          <br/>
          <button>When should I Zzzzz</button>
        <button >Let me see how I did</button>
        <h1 data-aos="fade-up">When should you sleep?</h1>
        <link rel="stylesheet" href="bower_components/aos/dist/aos.css" />
        <script src="bower_components/aos/dist/aos.js"></script> 
        </header>
      </div>
    );
  }
}

export default Header;
